import React, { Component } from 'react'
import { ListGroup, ListGroupItem } from 'react-bootstrap'

var taskList = [{ '2021-10-08': 'Ting-Yeh Birthday' },
                { '2021-10-30': 'Study Week Finish QQ' },
                { '2021-10-24': 'Study Week Start :)' } ,
                { '2021-10-08': 'PMC115 Quiz' }];

var ordered = {};
Object.keys(taskList).sort(function(a, b) {
    return moment(b, 'YYYY-MM-DD').toDate() - moment(a, 'YYYY-MM-DD').toDate();
        }).forEach(function(key) {
            ordered[key] = taskList[key];
        })
Object.keys(ordered).forEach(function(date) {
            document.body.innerHTML += date + "<br />"
});

export default class Tasks extends Component {
    render() {
        return (
            <ListGroup>
            <ListGroupItem href="#" active>
              ordered[1]
            </ListGroupItem>
            <ListGroupItem href="#">Link 2</ListGroupItem>
            <ListGroupItem href="#" disabled>
              Link 3
            </ListGroupItem>
          </ListGroup>
        )
    }
}
